import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Proveedores from "./Proveedores";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/proveedores" element={<Proveedores />} />
      </Routes>
    </Router>
  );
}

export default App;
